import s from './Navbar.module.css';

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <ul className={s.ul}>
                <li><a href='/profile'className={s.a}>Profile</a></li>
                <li><a href='/profile'className={s.a}>Messages</a></li>
                <li><a href='#'className={s.a}>News</a></li>
                <li><a href='#'className={s.a}>Music</a></li>
                <li><a href='#'className={s.a}>Settings</a></li>
            </ul>
        </nav>
    )
}
export default Navbar;
